import React from "react";
import { Navbar, Row, Col } from "react-bootstrap";

const Footer = () => {
  return (
    <Navbar sticky="bottom" className="bg-light">
      <Row>
        <Col>
          <h4>Company</h4>
        </Col>
        <Col>
          <h4>Resources</h4>
        </Col>
        <Col>
          <h4></h4>
        </Col>
      </Row>
    </Navbar>
  );
};

export default Footer;
